package com.frank.odatacarstore.annotation.model;import org.apache.olingo.odata2.api.annotation.edm.EdmEntitySet;import org.apache.olingo.odata2.api.annotation.edm.EdmEntityType;import org.apache.olingo.odata2.api.annotation.edm.EdmKey;import org.apache.olingo.odata2.api.annotation.edm.EdmNavigationProperty;import org.apache.olingo.odata2.api.annotation.edm.EdmNavigationProperty.Multiplicity;import org.apache.olingo.odata2.api.annotation.edm.EdmProperty;@EdmEntityType(namespace = "OData")@EdmEntitySet(name = "Users")public class User{    @EdmKey    @EdmProperty    private String id;    @EdmProperty    private String username;    @EdmProperty    private String password;    @EdmProperty    private String email;    public User(){}    public User(String id, String username, String password, String email) {        this.id = id;        this.username = username;        this.password = password;        this.email = email;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }}